import React, { useEffect, useState } from 'react';
import axios from 'axios';

const StudentDetails = () => {
    const [students, setStudents] = useState([]);

    const fetchStudents = async () => {
        try {
            const response = await axios.get('http://localhost:5000/api/admin/students', {
                headers: {
                    'x-admin-key': 'PLMokn15', // Use your admin key here
                },
            });
            setStudents(response.data);
        } catch (error) {
            console.error('Error fetching students:', error);
        }
    };

    useEffect(() => {
        fetchStudents();
    }, []);

    return (
        <div>
            <h2>Student Details Page</h2>
            {/* Add content to display detailed student info */}
            {students.length > 0 ? (
                <ul>
                    {students.map((student) => (
                        <li key={student._id}>
                            {student.registrationNumber} - {student.name}, CGPA: {student.cgpa}, 10th: {student.tenthPercent}%, 12th: {student.twelfthPercent}%, Arrears: {student.standingArrears}, Branch: {student.branch}
                        </li>
                    ))}
                </ul>
            ) : (
                <p>No students found</p>
            )}
        </div>
    );
};

export default StudentDetails;
